import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <>
      <nav>
        <ul>
          <li>
            <Link>Home</Link>
          </li>
          <li>
            <Link>About</Link>
          </li>
          <li>
            <Link>Conatct</Link>
          </li>
          <li>
            <Link>Account</Link>
          </li>
        </ul>
      </nav>
    </>
  );
};

export default Home;
